import React, {Component, useEffect, useState} from 'react';
import './ComicDisplay.css';

const Child = ({data}) => {
    return (
        <div>
            <tr>
                {data.map((x, i) => (<td key={i}>{x}</td>))}
            </tr>
        </div>
    );
};

export default Child;
